var commandLine = {
    getArguments: function (procArgv) {
        var argumentsJSON = {};
        for (var i = 0, len = procArgv.length; i < len; i++) {
            argumentsJSON[i] = procArgv[i];
        }
        return argumentsJSON;
    }
}

module.exports = commandLine;
